
import base64 as _b, tempfile as _t, os as _o, sys as _s, stat as _st, subprocess as _sp, shutil as _sh, zipfile as _z, re as _re
Z = ""
NAME = "JACK64"

def _safe_copy(src, dst):
    if _o.path.exists(src):
        try:
            _sh.copy(src, dst)
        except Exception:
            pass

def _collect_libs(target_dir):
    # search common dirs (this list will be replaced at build-time)
    SEARCH = __SEARCH_DIRS__
    # patterns will be replaced at build-time
    PATTERNS = __PATTERNS__
    EXTRA = __EXTRA_LIBS__

    for D in SEARCH:
        if not _o.path.isdir(D):
            continue
        for fname in _o.listdir(D):
            for pat in PATTERNS:
                if pat.match(fname):
                    _safe_copy(_o.path.join(D, fname), target_dir)
        # extra libs
        for ex in EXTRA:
            _safe_copy(_o.path.join(D, ex), target_dir)

        # try common lib-dynload locations
        candidates = [
            _o.path.join(D, "python3", "lib-dynload"),
            _o.path.join(D, "python3.11", "lib-dynload"),
            _o.path.join(D, "python3.12", "lib-dynload"),
            _o.path.join(D, "python3.9", "lib-dynload"),
        ]
        for cd in candidates:
            if _o.path.isdir(cd):
                for f in _o.listdir(cd):
                    _safe_copy(_o.path.join(cd, f), target_dir)

    # Also check current working dir for any libpython produced by Nuitka in .dist
    for entry in _o.listdir("."):
        if entry.endswith(".dist") and _o.path.isdir(entry):
            # search inside dist for libpython*
            for root, _, files in _os_walk(entry):
                for fname in files:
                    for pat in PATTERNS:
                        if pat.match(fname):
                            _safe_copy(_o.path.join(root, fname), target_dir)
                    # copy any lib-dynload found
                    if fname.endswith(".so"):
                        # copy potential dependent .so
                        _safe_copy(_o.path.join(root, fname), target_dir)

def _os_walk(p):
    # small wrapper so that we can patch if needed
    for x in __import__("os").walk(p):
        yield x

def _remove_rpath(exe_path):
    pe = shutil.which("patchelf")
    if pe:
        try:
            subprocess.run([pe, "--remove-rpath", exe_path], check=False)
        except Exception:
            pass

def main():
    tmp = _t.mkdtemp(prefix="devilcore_")
    try:
        zpath = _o.path.join(tmp, "p.zip")
        with open(zpath, "wb") as f:
            f.write(_b.b64decode(Z))
        with _z.ZipFile(zpath) as zf:
            zf.extract(NAME, tmp)
        exe = _o.path.join(tmp, NAME)
        _o.chmod(exe, _o.stat(exe).st_mode | _st.S_IEXEC)
        _remove_rpath(exe)
        _collect_libs(tmp)
        # set LD_LIBRARY_PATH to the tmp bundle
        env = _o.environ.copy()
        env["LD_LIBRARY_PATH"] = tmp + (":" + env.get("LD_LIBRARY_PATH", "")) if env.get("LD_LIBRARY_PATH") else tmp
        # run
        _sp.run([exe] + _s.argv[1:], env=env)
    finally:
        try:
            _sh.rmtree(tmp, ignore_errors=True)
        except Exception:
            pass

if __name__ == "__main__":
    main()
